import numpy as np

class Solution:
    def findDiagonalOrder(self, nums: List[List[int]]) -> List[int]:
        m, n = len(nums), len(nums[0])
        diagonal = [[] for _ in range(m + n - 1)]
        for i in range(m):
            for j in range(n):
                diagonal[i + j].append(nums[i][j])
        res = []
        for i in range(m + n - 1):
            if i % 2 == 0:
                res += diagonal[i][::-1]
            else:
                res += diagonal[i]
        return res

def main():
    solution = Solution()
    nums = [[1, 2, 3], [4, 5, 6], [7, 8, 9]]
    print(solution.findDiagonalOrder(nums))

if __name__ == "__main__":
    main()
